text:
To ensure smooth handling and quick delivery of #CovidVaccine, #JaipurAirport facilitated movement of Covaxin of 119990 Doses, 42 boxes, wt.1153 kgs through Indigo flight 6E-913 from Hyderabad on 24 July 2021.
Shipment delivered to consignee.
